/* eslint-disable react/prefer-stateless-function */
import React from 'react';
import books from '../products';

export default class BooksList extends React.Component {
  render() {
    return (
      <>
        <h1>Lista de Livros</h1>
        <ul>
          {books.map((book) => (
            <li key={book.name}>
              {book.name}
            </li>
          ))}
        </ul>
      </>
    );
  }
}
